import React, { Component } from "react";
import { Col, Tag } from "antd";
import styled from "styled-components";

export class MyTag extends Component {
  render() {
    return (
      <Col span={8}>
        <h4 style={{ marginBottom: 16 }}>Presets:</h4>
        <div>
          <Tag color="magenta" style={{ backgroundColor: "#f3f7f820", textTransform: "uppercase" }}>
            Programmer
          </Tag>
          {/* <StyledTag color="red">Student</StyledTag> */}
          <Tag color="volcano" style={{ backgroundColor: "#f3f7f820" }}>
            Actor
          </Tag>
          {/* <Tag color="orange">orange</Tag> */}
          <Tag color="gold" style={{ backgroundColor: "#f3f7f820" }}>
            Guitarist
          </Tag>
          {/* <Tag color="lime">lime</Tag> */}
          <Tag color="green" style={{ backgroundColor: "#f3f7f820" }}>
            Student
          </Tag>
          {/* <Tag color="cyan">cyan</Tag> */}
          {/* <Tag color="blue">blue</Tag> */}
          {/* <Tag color="geekblue">geekblue</Tag> */}
          {/* <Tag color="purple" visible="false">purple</Tag> */}
        </div>
      </Col>
    );
  }
}

export default MyTag;
